/*Table structure for table `caseinfo` */

DROP TABLE IF EXISTS `caseinfo`;

CREATE TABLE `caseinfo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `caseId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '用例ID',
  `caseName` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '用例名称',
  `caseParam` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '用例参数化',
  `sysId` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '所属系统编号',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT 'case状态 （1启用 2禁用）',
  `pin` varchar(50) COLLATE utf8_bin NOT NULL COMMENT 'case所属者pin',
  `updateTime` datetime NOT NULL COMMENT '修改时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  UNIQUE KEY `caseid` (`caseId`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  KEY `pin` (`pin`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=628 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用例表';

