/*Table structure for table `interface_result` */

DROP TABLE IF EXISTS `interface_result`;

CREATE TABLE `interface_result` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `resultId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '结果编号',
  `taskId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '测试计划编号',
  `caseId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '用例编号',
  `interfaceId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '接口编号',
  `pin` varchar(100) COLLATE utf8_bin NOT NULL COMMENT 'pin（接口所属人）',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '接口名称',
  `url` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '请求地址',
  `head` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '报文请求头',
  `ip` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT 'jsf服务ip地址端口号',
  `alias` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'jsf接口分组名称',
  `token` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'token',
  `body` text COLLATE utf8_bin COMMENT '请求内容',
  `method` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '请求方法（针对jsf接口调用的方法名称）',
  `type` int(11) NOT NULL COMMENT '接口类型(1jsf  2post  3get)',
  `dataFetch` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '数据提取器',
  `dataCheckPoint` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '数据库检查点',
  `checkPoint` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '普通检查点',
  `resBody` text COLLATE utf8_bin COMMENT '结果返回结果',
  `result` int(2) NOT NULL COMMENT '返回结果',
  `resultCode` int(20) NOT NULL COMMENT '执行结果编码',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `exeTime` double DEFAULT NULL,
  `UUID` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `updateTime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`,`createTime`),
  UNIQUE KEY `UUID` (`UUID`)
) ENGINE=InnoDB AUTO_INCREMENT=3385 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='接口表';

