/*Table structure for table `interface_test` */

DROP TABLE IF EXISTS `interface_test`;

CREATE TABLE `interface_test` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `interfaceId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT 'uuid',
  `pin` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'pin（接口所属人）',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '接口名称',
  `url` varchar(200) COLLATE utf8_bin NOT NULL COMMENT '请求地址',
  `head` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '报文请求头',
  `ip` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT 'jsf服务ip地址端口号',
  `alias` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'jsf接口分组名称',
  `body` text COLLATE utf8_bin COMMENT '请求内容',
  `method` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '请求方法（针对jsf接口调用的方法名称）',
  `type` int(11) NOT NULL COMMENT '接口类型(1jsf  2post  3get)',
  `dataFetch` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '数据提取器',
  `dataCheckPoint` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '数据库检查点',
  `checkPoint` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '普通检查点',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '接口状态（1、启用 2、禁用）',
  `updateTime` datetime NOT NULL COMMENT '修改时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uuid` (`interfaceId`) USING BTREE,
  KEY `name_index` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=240 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='接口表';

/*Data for the table `interface_test` */

/*Table structure for table `job_timertask` */

DROP TABLE IF EXISTS `job_timertask`;

CREATE TABLE `job_timertask` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `taskId` varchar(64) DEFAULT NULL COMMENT '业务单号',
  `taskData` text NOT NULL COMMENT '任务数据',
  `taskStatus` smallint(5) unsigned NOT NULL COMMENT '任务状态',
  `retryCount` smallint(5) unsigned NOT NULL COMMENT '运行次数',
  `uuid` varchar(96) NOT NULL COMMENT 'UUID',
  `errorMsg` text COMMENT '错误原因',
  `bizTime` datetime NOT NULL COMMENT '创建时间',
  `resultStatus` smallint(5) unsigned DEFAULT NULL COMMENT '任务结果.0:表示任务初始,1:表示任务成功,2:表示任务失败',
  `lastUpdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `remark` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_uuid` (`uuid`),
  KEY `index_taskId` (`taskId`)
) ENGINE=InnoDB AUTO_INCREMENT=11896 DEFAULT CHARSET=utf8 COMMENT='定时任务';

