/*Table structure for table `job_timertaskconfig` */

DROP TABLE IF EXISTS `job_timertaskconfig`;

CREATE TABLE `job_timertaskconfig` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `taskId` varchar(100) NOT NULL COMMENT '任务id,task表的',
  `taskTimerKey` varchar(100) NOT NULL COMMENT '定时任务标识',
  `taskTimerDesc` varchar(100) NOT NULL COMMENT '定时任务描述',
  `dataType` varchar(100) DEFAULT NULL COMMENT '数据类型 month表示每月执行一次，day表示每天执行一次，hour表示每小时执行一次,minute表示每分钟执行',
  `year` int(11) DEFAULT NULL,
  `month` int(11) DEFAULT NULL,
  `day` int(11) DEFAULT NULL,
  `hour` int(11) DEFAULT NULL,
  `minute` int(11) DEFAULT NULL,
  `second` int(11) DEFAULT NULL,
  `biztime` datetime DEFAULT NULL,
  `status` int(11) DEFAULT NULL COMMENT '任务状态。0:停止，1:启动',
  `createtime` datetime DEFAULT NULL,
  `lastupdatetime` datetime DEFAULT NULL,
  `endtime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `taskTimerKey` (`taskTimerKey`) USING BTREE,
  KEY `index_taskId` (`taskId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='任务时间表';

