/*Table structure for table `mq` */

DROP TABLE IF EXISTS `mq`;

CREATE TABLE `mq` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `jmqId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT 'uuid',
  `pin` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'pin（jmq所属人）',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT 'mq名称',
  `topic` varchar(50) COLLATE utf8_bin NOT NULL COMMENT 'mq主题',
  `app` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '应用名',
  `password` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '应用密码',
  `body` text COLLATE utf8_bin COMMENT 'jmq请求内容',
  `type` int(11) NOT NULL COMMENT 'mq类型(1 jmq  2 mq)',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT 'mq状态（1、启用 2、禁用）',
  `updateTime` datetime NOT NULL COMMENT '修改时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uuid` (`jmqId`) USING BTREE,
  KEY `name_index` (`name`) USING BTREE,
  KEY `pin_index` (`pin`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='MQ表';

