/*Table structure for table `task_result` */

DROP TABLE IF EXISTS `task_result`;

CREATE TABLE `task_result` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `resultId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '执行结果编号',
  `resultName` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '结果名称',
  `taskId` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '任务编号',
  `taskName` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '任务名称',
  `taskParam` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '任务参数化信息',
  `pin` varchar(50) COLLATE utf8_bin NOT NULL COMMENT 'pin(执行人)',
  `successRate` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '成功率',
  `isfinish` int(11) NOT NULL DEFAULT '1' COMMENT '是否执行结束（1、未结束 2、结束）',
  `updateTime` datetime NOT NULL COMMENT '执行完成时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `remark` varchar(500) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=530 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='执行结果表';

