/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `username` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '用户名',
  `password` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '密码',
  `sex` int(11) NOT NULL COMMENT '性别',
  `birthday` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '出生日期',
  UNIQUE KEY `id` (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `user` */

/*Table structure for table `user_test` */

DROP TABLE IF EXISTS `user_test`;

CREATE TABLE `user_test` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `pin` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'pin',
  `userName` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '用户名',
  `remark` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  `updateTime` datetime NOT NULL COMMENT '修改时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='测试用户表';

